sp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-------------/" target="_blank"></a>&nbsp;<a href="/s/-----%E5%BC%A0%E6%B6%9B--------/" target="_blank">张涛</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/8/" target="_blank">爱情片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2016/" target="_blank">2016</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>&nbsp;在古老的东方，一直流传着一种残酷的刑术-活剥人皮年轻的勇士苏赫巴兽被公主的年轻貌美所吸引，抵挡不住内心对公主的向往，凌辱了公主，被处以活剥人皮这一刑罚。谁知被剥去人皮的苏赫巴兽不但没有死，反而得到了一股神奇的力量，一系列的报复计划就这样展开了</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/79615/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/77238/" data-original="http://cj.subo8988.com:8988/upload/vod/2018-10-16/201810161539689803.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">5.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/77238/">新木乃伊[国语]</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%B1%A4%E5%A7%86%C2%B7%E5%85%8B%E9%B2%81%E6%96%AF------------/" target="_blank">汤姆·克鲁斯</a>&nbsp;<a href="/s/-%E7%BD%97%E7%B4%A0%C2%B7%E5%85%8B%E5%8A%B3------------/" target="_blank">罗素·克劳</a>&nbsp;<a href="/s/-%E5%AE%89%E5%A8%9C%E8%B4%9D%E6%8B%89%C2%B7%E6%B2%83%E4%B8%BD%E4%B8%9D------------/" target="_blank">安娜贝拉·沃丽丝</a>&nbsp;<a href="/s/-%E7%B4%A2%E8%8F%B2%E4%BA%9A%C2%B7%E6%B3%A2%E5%A4%9A%E6%8B%89------------/" target="_blank">索菲亚·波多拉</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E8%89%BE%E9%87%8C%E5%85%8B%E6%96%AF%C2%B7%E5%BA%93%E5%85%B9%E6%9B%BC--------/" target="_blank">艾里克斯·库兹曼</a>&nbsp;<a href="/s/-------------/" target="_blank"></a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/9/" target="_blank">科幻片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E7%BE%8E%E5%9B%BD-----------/" target="_blank">美国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2017/" target="_blank">2017</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>新版《木乃伊》讲述了一个全新故事，木乃伊公主阿玛内特穿梭到现代伦敦，企图寻回她曾被夺去的一切本片由动作巨星汤姆·克鲁斯主演。凭借《王牌特工》中的 “刀锋女”一角大热的新锐女星索菲亚·宝特拉饰演有巨大毁灭力量的木乃伊公主阿玛内特，而好莱坞著名硬汉男星罗素·克劳 也有精彩表现。导演艾里克斯·库兹曼为好莱</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/77238/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/23650/" data-original="http://pic.iqiyi6123.com/upload/vod/2019-01-17/154771943916.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">6.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center"></span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/23650/">木乃伊的秘密</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%89%98%E6%AF%94%E4%BA%9A%E6%96%AF%C2%B7%E8%8E%AB%E9%9B%B7%E8%92%82Tobias------------/" target="_blank">托比亚斯·莫雷蒂Tobias</a>&nbsp;<a href="/s/-Moretti------------/" target="_blank">Moretti</a>&nbsp;<a href="/s/-%E5%8D%A1%E4%BD%B3%C2%B7%E7%BB%B4%E5%B2%91%E5%8D%9A%E7%A7%91Katja------------/" target="_blank">卡佳·维岑博科Katja</a>&nbsp;<a href="/s/-Weitzenbock------------/" target="_blank">Weitzenbock</a>&nbsp;<a href="/s/-%E6%9C%AC%E6%9D%B0%E6%98%8E%C2%B7%E8%90%A8%E5%BE%B7%E5%8B%92Benjamin------------/" target="_blank">本杰明·萨德勒Benjamin</a>&nbsp;<a href="/s/-Sadler------------/" target="_blank">Sadler</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%BA%93%E5%B0%94%E7%89%B9%C2%B7%E5%AF%8C%E9%A1%BFCurt--------/" target="_blank">库尔特·富顿Curt</a>&nbsp;<a href="/s/-----M.--------/" target="_blank">M.</a>&nbsp;<a href="/s/-----Faudon--------/" target="_blank">Faudon</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/9/" target="_blank">科幻片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2000/" target="_blank">2000</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>伊保拉、卡尔和福瑞德是好朋友,三人都酷爱潜水.可水下的一场意外,使得卡尔和福瑞德心存芥蒂,分道扬镳.两年后,卡尔和保拉在维也纳的进行地下测量时遭遇坍方.卡尔被困在了藏有文身木乃伊的地下墓穴中.福瑞德回到保拉身边,帮忙救卡尔.救援行动正紧锣密鼓时,卡尔却悄悄带着墓穴中的金币出现在保拉和福瑞德面前.狠毒</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/23650/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/63952/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2019-02-25/201902251551089801.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">6.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280高清中字版</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/63952/">木乃伊1</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E5%B8%83%E5%85%B0%E7%99%BB%C2%B7%E8%B4%B9%E8%88%8D------------/" target="_blank">布兰登·费舍</a>&nbsp;<a href="/s/-%E8%95%BE%E5%88%87%E5%B0%94%C2%B7%E8%96%87%E5%85%B9------------/" target="_blank">蕾切尔·薇兹</a>&nbsp;<a href="/s/-%E7%BA%A6%E7%BF%B0%C2%B7%E6%B1%89%E7%BA%B3------------/" target="_blank">约翰·汉纳</a>&nbsp;<a href="/s/-%E9%98%BF%E8%AF%BA%E5%BE%B7%C2%B7%E6%B2%83%E6%96%AF%E6%B4%9B------------/" target="_blank">阿诺德·沃斯洛</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%96%AF%E8%92%82%E8%8A%AC%C2%B7%E7%B4%A2%E8%8E%AB%E6%96%AF--------/" target="_blank">斯蒂芬·索莫斯</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/6/" target="_blank">动作片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E7%BE%8E%E5%9B%BD-----------/" target="_blank">美国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------1999/" target="_blank">1999</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>埃及城市哈姆纳塔是历代法老墓地，相传此处拥有法老留下的大量珍奇异宝，源源不断的人前往掘金，但却生还者寥寥哈姆纳塔因此成为谜样的所在，获名“亡灵之城”。图书管理员伊芙琳（Rachel Weisz 瑞切尔·薇茨饰）偶然得到一张哈姆纳塔的地图，大为兴奋的她决定和哥哥一起去那儿考古，他们找到曾经的幸存者欧康</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/63952/">查看详情</a></dd></dl><div class="fed-page-info fed-text-center"><a class="fed-btns-info fed-rims-info fed-hide fed-show-xs-inline fed-btns-disad" href="/s/%E6%9C%A8%E4%B9%83%E4%BC%8A------------/">首页</a><a class="fed-btns-info fed-rims-info fed-btns-disad" href="/s/%E6%9C%A8%E4%B9%83%E4%BC%8A------------/">上页</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline fed-btns-green" href="javascript:;">1</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline" href="/s/%E6%9C%A8%E4%B9%83%E4%BC%8A----------2---/">2</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-xs-inline" href="javascript:;">1/2</a><a class="fed-btns-info fed-rims-info" href="/s/%E6%9C%A8%E4%B9%83%E4%BC%8A----------2---/">下页</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-xs-inline" href="/s/%E6%9C%A8%E4%B9%83%E4%BC%8A----------2---/">尾页</a><input class="fed-rims-info" type="text" placeholder="输入页码" autocomplete="off"><a class="fed-btns-info fed-rims-info fed-page-jump" data-url="/s/%E6%9C%A8%E4%B9%83%E4%BC%8A----------PAGELINK---/